import React from 'react';
import fo from '../assets/images/yo.png';



const Home = () => {
  return (
    <div className=' w-full h-full  bg-gradient-to-br from-blue-400 to-slate-500'>
    <div className='flex justify-center flex-col w-full h-full  max-w-screen-sm mx-auto'>
        <div>
          <img src={fo} alt=''/>
          <div className='bg-white'>
            <div className='flex justify-center flex-col mx-10 py-2'>
            <div className=' bg-orange-500 w-32 text-white uppercase rounded-lg'><p className='mx-3'>Technology</p></div>

            <p >How I build Web devlopment Challenges Website</p>
            </div>
            </div>
        </div>
    </div>
    </div>

  )
}

export default Home
